tems to display only for specified user roles</li>\r\n 	<li>Configure widgets to display only if a user is logged or not logged in</li>\r\n 	<li>Configure widgets to display only for specified user roles</li>\r\n 	<li>Use the `[tml-require-role]` shortcode to restrict content within a post or page to a specific role</li>\r\n 	<li>Use the `[tml-require-user]` shortcode to restrict content within a post or page to a specific user or all logged in users</li>\r\n</ul>\";s:7:\"excerpt\";s:78:\"Restrict posts, pages, pieces of content and menu items by user role and more.\";s:9:\"thumbnail\";s:65:\"https://thememylogin.com/app/uploads/edd/2018/06/restrictions.png\";s:8:\"category\";b:0;s:4:\"tags\";b:0;}s:7:\"pricing\";O:8:\"stdClass\":3:{s:10:\"singlesite\";s:5:\"10.00\";s:8:\"2-5sites\";s:5:\"25.00\";s:14:\"unlimitedsites\";s:5:\"40.00\";}s:9:\"licensing\";O:8:\"stdClass\":4:{s:7:\"enabled\";b:1;s:7:\"version\";s:3:\"1.1\";s:8:\"exp_unit\";s:5:\"years\";s:10:\"exp_length\";s:1:\"1\";}}i:5;O:8:\"stdClass\":3:{s:4:\"info\";O:8:\"stdClass\":12:{s:2:\"id\";i:83;s:4:\"slug\";s:13:\"legacy-bundle\";s:5:\"title\";s:13:\"Legacy Bundle\";s:11:\"create_date\";s:19:\"2018-06-01 10:10:23\";s:13:\"modified_date\";s:19:\"2018-07-06 13:49:22\";s:6:\"status\";s:7:\"publish\";s:4:\"link\";s:50:\"https://thememylogin.com/extensions/legacy-bundle/\";s:7:\"content\";s:634:\"Get all 6 \"legacy\" extensions for a <strong>30% discount</strong>. This bundle includes the following extensions:\r\n<ul>\r\n 	<li><a href=\"https://thememylogin.com/extensions/moderation/\">Moderation</a></li>\r\n 	<li><a href=\"https://thememylogin.com/extensions/notifications/\">Notifications</a></li>\r\n 	<li><a href=\"https://thememylogin.com/extensions/profiles/\">Profiles</a></li>\r\n 	<li><a href=\"https://thememylogin.com/extensions/recaptcha/\">reCAPTCHA</a></li>\r\n 	<li><a href=\"https://thememylogin.com/extensions/redirection/\">Redirection</a></li>\r\n 	<li><a href=\"https://thememylogin.com/extensions/s